import React, { Component } from 'react';

class GroceryList extends Component{
  constructor(props) {
    super(props);
    this.state = {added_elements:['ash']};
  }
  render(){
    return(
      <div>
        <ul>
        <li>{this.state.added_elements[0]}</li>
        <li>{this.state.added_elements[0]}</li>
        <li>{this.state.added_elements[0]}</li>
        </ul>

      </div>
    );
  }
}


export default GroceryList;
